n=""
l = len(n)
max=0
for i in range(l-12):
    s1 = int(n[i])
    s2 = int(n[i+1])
    s3 = int(n[i+2])
    s4 = int(n[i+3])
    s5 = int(n[i+4])
    s6 = int(n[i+5])
    s7 = int(n[i+6])
    s8 = int(n[i+7])
    s9 = int(n[i+8])
    s10 = int(n[i+9])
    s11 = int(n[i+10])
    s12 = int(n[i+11])
    s13 = int(n[i+12])
    s = s1*s2*s3*s4*s5*s6*s7*s8*s9*s10*s11*s12*s13
    if(s>max):
        max=s
print(max)
